description:
A follow up to the award winning Manson (1973) this documentary is alot of the raw footage not used in that documentary with interviews and narration. Some really chilling moments. I ripped this from the DVD in 10 minute increments. The aspect ratio is incorrect, the DVD has 4:3 stretched to 16:9 and letterboxed.
